css:
atom-text-editor,
:host {
  background-color: #282828;
  color: #ebdbb2;
}
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background-color: rgba(249, 245, 215, 0.04);
}
atom-text-editor .invisible,
:host .invisible {
  color: #ebdbb2;
}
atom-text-editor .cursor,
:host .cursor {
  border-left: 2px solid #a89984;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #424242;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border-bottom: 2px solid #a89984;
  box-sizing: border-box;
  background-color: #373737;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(235, 219, 178, 0.15);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(235, 219, 178, 0.15);
}
atom-text-editor .indent-guide:nth-child(2n),
:host .indent-guide:nth-child(2n) {
  box-shadow: inset 1px 0 rgba(235, 219, 178, 0.25);
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(235, 219, 178, 0.15);
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  color: #928374;
  -webkit-font-smoothing: antialiased;
}
atom-text-editor .gutter .line-number.git-line-removed:before,
:host .gutter .line-number.git-line-removed:before {
  bottom: -3px;
}
atom-text-editor .gutter .line-number.git-line-removed:after,
:host .gutter .line-number.git-line-removed:after {
  content: "";
  position: absolute;
  left: 0px;
  bottom: 0px;
  width: 25px;
  border-bottom: 1px dotted rgba(251, 73, 52, 0.5);
  pointer-events: none;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  color: #f9f5d7;
  background-color: rgba(249, 245, 215, 0.04);
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  background-color: rgba(249, 245, 215, 0.04);
}
atom-text-editor .gutter .line-number .icon-right,
:host .gutter .line-number .icon-right {
  color: #ebdbb2;
}
atom-text-editor .gutter .line-number .icon-right,
:host .gutter .line-number .icon-right {
  color: #ebdbb2;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #f9f5d7;
}
.comment {
  color: #928374;
  font-style: italic;
  /* Keywords inside comments (e.g. yard, javadoc, etc) should be more subdued
     than other keywords */
}
.comment .keyword,
.comment .keyword.punctuation {
  color: #d5c4a1;
}
.comment .punctuation {
  color: #bdae93;
}
.comment .string,
.comment .type,
.comment .parameter {
  color: #bdae93;
}
.entity.name.type {
  color: #fabd2f;
}
.entity.other.inherited-class {
  color: #fabd2f;
}
.keyword {
  color: #fb4934;
}
.keyword.control {
  color: #fb4934;
}
.keyword.operator {
  color: #ebdbb2;
}
.keyword.other.special-method {
  color: #fe8019;
}
.keyword.other.unit {
  color: #d3869b;
}
.storage {
  color: #fb4934;
}
.storage.type.annotation,
.storage.type.primitive {
  color: #fb4934;
}
.storage.modifier.package,
.storage.modifier.import {
  color: #ebdbb2;
}
.constant {
  color: #d3869b;
}
.constant.variable {
  color: #d3869b;
}
.constant.character.escape {
  color: #fb4934;
}
.constant.numeric {
  color: #d3869b;
}
.constant.other.color {
  color: #fb4934;
}
.constant.other.symbol {
  color: #d3869b;
}
.variable {
  color: #83a598;
}
.variable.interpolation {
  color: #458588;
}
.variable.parameter {
  color: #ebdbb2;
}
.invalid.illegal {
  background-color: #83a598;
  color: #282828;
}
.string {
  color: #b8bb26;
}
.string.regexp {
  color: #fb4934;
}
.string.regexp .source.ruby.embedded {
  color: #fabd2f;
}
.string.other.link {
  color: #83a598;
}
.punctuation.definition.comment {
  color: #928374;
}
.punctuation.definition.tag {
  color: #83a598;
}
.punctuation.definition.method-parameters,
.punctuation.definition.function-parameters,
.punctuation.definition.parameters,
.punctuation.definition.separator,
.punctuation.definition.seperator,
.punctuation.definition.array {
  color: #ebdbb2;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #b8bb26;
}
.punctuation.definition.bold {
  color: #fabd2f;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #fb4934;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #83a598;
}
.punctuation.section.method,
.punctuation.section.class,
.punctuation.section.inner-class {
  color: #ebdbb2;
}
.support.class {
  color: #fabd2f;
}
.support.function {
  color: #fe8019;
}
.support.function.any-method {
  color: #b8bb26;
}
.entity.name.function {
  color: #b8bb26;
}
.entity.name.class,
.entity.name.type.class {
  color: #fabd2f;
}
.entity.name.class .punctuation.separator,
.entity.name.type.class .punctuation.separator {
  color: #ebdbb2;
}
.entity.name.section {
  color: #b8bb26;
}
.entity.name.tag {
  color: #83a598;
}
.entity.other.attribute-name {
  color: #d3869b;
}
.entity.other.attribute-name.id {
  color: #b8bb26;
}
.meta.class {
  color: #fabd2f;
}
.meta.class.body {
  color: #ebdbb2;
}
.meta.method-call,
.meta.method {
  color: #ebdbb2;
}
.meta.definition.variable {
  color: #83a598;
}
.meta.link {
  color: #d3869b;
}
.meta.require {
  color: #b8bb26;
}
.meta.selector {
  color: #fb4934;
}
.meta.separator {
  background-color: #373b41;
  color: #ebdbb2;
}
.meta.tag {
  color: #ebdbb2;
}
.none {
  color: #ebdbb2;
}
.markup.bold {
  color: #d3869b;
  font-weight: bold;
}
.markup.changed {
  color: #fb4934;
}
.markup.deleted {
  color: #83a598;
}
.markup.italic {
  color: #fb4934;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #b8bb26;
}
.markup.inserted {
  color: #fabd2f;
}
.markup.list {
  color: #83a598;
}
.markup.quote {
  color: #d3869b;
}
.markup.raw.inline {
  color: #fabd2f;
}
.source.cs .keyword.operator {
  color: #fb4934;
}
.source.css .property-name,
.source.css .property-value {
  color: #d5c4a1;
}
.source.css .property-name.support,
.source.css .property-value.support {
  color: #ebdbb2;
}
.source.diff {
  color: #a89984;
}
.source.diff .meta {
  color: #83a598;
}
.source.diff .meta.header.from-file {
  color: #8ec07c;
}
.source.diff .meta.header.to-file {
  color: #8ec07c;
}
.source.diff .meta.diff.range {
  color: #fabd2f;
}
.source.diff .meta.diff.line-number {
  color: #fabd2f;
  opacity: 1;
}
.source.diff .markup.deleted {
  color: #fb4934;
}
.source.diff .markup.inserted {
  color: #b8bb26;
}
.source.diff .punctuation.deleted {
  color: #fb4934;
}
.source.diff .punctuation.inserted {
  color: #b8bb26;
}
.source.diff .punctuation.range {
  color: #fabd2f;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #83a598;
}
.source.gfm .markup.link {
  color: #fb4934;
}
.source.gfm .link .entity {
  color: #b8bb26;
}
.source.ini .keyword.other.definition.ini {
  color: #83a598;
}
.source.java .storage.modifier.import {
  color: #fabd2f;
}
.source.java .storage.type {
  color: #fabd2f;
}
.source.java-properties .meta.key-pair {
  color: #83a598;
}
.source.java-properties .meta.key-pair > .punctuation {
  color: #ebdbb2;
}
.source.json .meta.structure.dictionary.json > .string.quoted.json {
  color: #83a598;
}
.source.json .meta.structure.dictionary.json > .string.quoted.json > .punctuation.string {
  color: #83a598;
}
.source.json .meta.structure.dictionary.json > .value.json > .string.quoted.json,
.source.json .meta.structure.array.json > .value.json > .string.quoted.json,
.source.json .meta.structure.dictionary.json > .value.json > .string.quoted.json > .punctuation,
.source.json .meta.structure.array.json > .value.json > .string.quoted.json > .punctuation {
  color: #fabd2f;
}
.source.json .meta.structure.dictionary.json > .constant.language.json,
.source.json .meta.structure.array.json > .constant.language.json {
  color: #fb4934;
}
.source.ruby .constant.other.symbol > .punctuation {
  color: inherit;
}
.source.ruby .punctuation.separator.namespace {
  color: #fabd2f;
}
.source.python .keyword.operator.logical.python {
  color: #fb4934;
}
.source.python .variable.parameter {
  color: #d3869b;
}
